import React from "react";
import purchase from "../svg/Purchase.svg";
import register from "../svg/register.svg";
import Person from "../svg/Person.svg";

export default function productIcon() {
  return (
    <div>
      <footer style="display: flex; justify-content: flex-end;">
        <div className="btn-purchase">
          <a href="Purchase.html">
            {/* <image src={purchase} alt="purchase" width="50" height="50" /> */}
            <image src={Person} alt="person" width="50" height="50" />
          </a>
        </div>
        <div className="btn-product_registration">
          <a href="product_registration.html">
            {/* <image src={register} alt="register" width="50" height="50" /> */}
            <image src={Person} alt="person" width="50" height="50" />
          </a>
        </div>
      </footer>
    </div>
  );
}
